-- Oracle version check                                                                           
whenever sqlerror exit;                                                                           
DECLARE                                                                                           
   lv_minor_pos NUMBER (3, 1);                                                                    
   lv_patch_pos NUMBER (3, 1);                                                                    
                                                                                                  
   lv_version   NUMBER (3, 1);                                                                    
   lv_release   NUMBER (3, 1);                                                                    
BEGIN                                                                                             
   SELECT INSTR(VERSION, '.', 1, 2)                                                               
     INTO lv_minor_pos                                                                            
     FROM v$instance;                                                                             
   SELECT INSTR(VERSION, '.', 1, 4)                                                               
     INTO lv_patch_pos                                                                            
     FROM v$instance;                                                                             
                                                                                                  
   SELECT TO_NUMBER (SUBSTR (VERSION, 1, lv_minor_pos-1), '99.99')                                
     INTO lv_version                                                                              
     FROM v$instance;                                                                             
                                                                                                  
   SELECT TO_NUMBER (SUBSTR (VERSION, lv_minor_pos+1, lv_patch_pos - lv_minor_pos - 1), '99.99')  
     INTO lv_release                                                                              
     FROM v$instance;                                                                             
                                                                                                  
   IF lv_version < 9.2 or                                                                        
      (lv_version = 9.2 and lv_release < 0.4)                                                    
   THEN                                                                                           
      raise_application_error                                                                     
         (-20001,                                                                                 
          'Oracle Version needs to be 9.2.0.4 or greater to install Spotlight on Oracle objects.' 
         );                                                                                       
   END IF;                                                                                        
END;                                                                                              
