CREATE OR REPLACE PROCEDURE sys.build_xview( p_xtable_name VARCHAR2,
                                             p_user_name VARCHAR2   ) IS

   stmt     VARCHAR2(1000);

   amended_table_name VARCHAR2(31);

   table_already_exists EXCEPTION;
   PRAGMA EXCEPTION_INIT(table_already_exists,-955);

   table_not_exists EXCEPTION;
   PRAGMA EXCEPTION_INIT(table_not_exists,-942);

BEGIN
   amended_table_name:=SUBSTR(p_xtable_name,1,1)||'_'||SUBSTR(p_xtable_name,2);

   -- create views: v_$, and x_$
   BEGIN

      IF UPPER(p_xtable_name) LIKE 'X%' THEN
         stmt:='CREATE OR REPLACE VIEW '||amended_table_name||' AS SELECT * FROM '||p_xtable_name;
      ELSE
         stmt:='CREATE VIEW '||amended_table_name||' AS SELECT * FROM '||p_xtable_name;
      END IF;

      EXECUTE IMMEDIATE stmt;

   EXCEPTION WHEN table_already_exists THEN null;
             WHEN table_not_exists     THEN null;
   END;  -- end of create views v_$ and x_$

   -- create public synonyms
   BEGIN
      IF UPPER(p_xtable_name) LIKE 'X%' THEN
         stmt := 'create or replace public synonym '||p_xtable_name||' for '||amended_table_name;
      ELSE
         stmt := 'create public synonym '||p_xtable_name||' for '||amended_table_name;
      END IF;
      EXECUTE IMMEDIATE stmt;

   EXCEPTION WHEN table_already_exists THEN null;
   END;   -- end of create public synonyms

   -- grant privileges on v_$ and x_$
   stmt := 'grant SELECT on '||amended_table_name||' to '||p_user_name;
   EXECUTE IMMEDIATE stmt;
   EXCEPTION WHEN table_already_exists THEN null;
END;

