GRANT CREATE PROCEDURE,CREATE TABLE,CREATE TYPE,CREATE SESSION,CREATE SEQUENCE,CREATE SYNONYM, CREATE DATABASE LINK, ALTER SESSION , SELECT ANY TABLE, ALTER system  TO &&REPOSITORY_OWNER

/ 
DECLARE

   ora_version       VARCHAR2(64);
   is11gorgreater    BOOLEAN:=FALSE;
   instance_name     VARCHAR2(50);

   CURSOR c1 IS
      SELECT NVL (directory_name, DECODE (NAME,
                          'background_dump_dest', 'QUEST_SOO_BDUMP_DIR',
                          'user_dump_dest', 'QUEST_SOO_UDUMP_DIR',
                          'core_dump_dest', 'QUEST_SOO_CDUMP_DIR',
                          'audit_file_dest', 'QUEST_SOO_ADUMP_DIR') ) NAME,
             REPLACE(value, '@', instance_name)
                || DECODE (INSTR (VALUE, '/'), 0, '\', '/') value,
             DECODE (directory_name, NULL, 'F', 'T') dir_exists
        FROM v$parameter param, dba_directories dir
       WHERE NAME IN ('background_dump_dest', 'user_dump_dest',
                      'core_dump_dest', 'audit_file_dest')
         AND dir.directory_path(+) = (REPLACE(param.VALUE, '@', instance_name)
                                         || DECODE (INSTR (VALUE, '/'), 0, '\', '/'))
         AND dir.directory_name(+) LIKE 'QUEST_SOO%'
      UNION
      SELECT directory_name, directory_path, 'T'
        FROM dba_directories
       WHERE directory_name LIKE 'QUEST_SOO%';

BEGIN

   SELECT instance_name
     INTO instance_name
     FROM v$instance;

   SELECT SUBSTR(SUBSTR(banner,INSTR(banner,'Release ')+8), 1, 6) INTO ora_version
     FROM v$version
    WHERE banner LIKE 'Oracle%'
       OR banner LIKE 'Personal Oracle%';

   IF ora_version LIKE '11%' OR ora_version LIKE '12%' THEN
      is11gorgreater:=TRUE;
   END IF;

   FOR r1 in (SELECT name FROM sys.v_$fixed_table WHERE name LIKE 'V$%') LOOP
      sys.build_xview(r1.name,'&&REPOSITORY_OWNER');
   END LOOP;

   -- at least 8.1.6 on NT doesn't have this one in the v_$fixed_table.  Add it
   sys.build_xview('V$ROLLNAME', '&&REPOSITORY_OWNER');

   sys.build_xview('X$BH',       '&&REPOSITORY_OWNER');
   sys.build_xview('X$KSUSECST', '&&REPOSITORY_OWNER');
   sys.build_xview('X$KSLES',    '&&REPOSITORY_OWNER');
   sys.build_xview('X$KSLED',    '&&REPOSITORY_OWNER');
   sys.build_xview('X$KSUSESTA', '&&REPOSITORY_OWNER');
   sys.build_xview('X$KSPPI',    '&&REPOSITORY_OWNER');
   sys.build_xview('X$KSBDP',    '&&REPOSITORY_OWNER');
   sys.build_xview('X$KSPPCV',   '&&REPOSITORY_OWNER');
   sys.build_xview('X$KSPPSV',   '&&REPOSITORY_OWNER');
   sys.build_xview('X$KSQRS',    '&&REPOSITORY_OWNER');
   sys.build_xview('X$KSLEI',    '&&REPOSITORY_OWNER');
   IF is11gorgreater THEN
      sys.build_xview('X$KSLLTR',    '&&REPOSITORY_OWNER');
   ELSE
      sys.build_xview('X$KSLLT',    '&&REPOSITORY_OWNER');
      sys.build_xview('X$KSLLD',    '&&REPOSITORY_OWNER');
   END IF;
   sys.build_xview('X$KSMLRU',   '&&REPOSITORY_OWNER');
   sys.build_xview('X$KCBFWAIT', '&&REPOSITORY_OWNER');
   sys.build_xview('X$KSMSP',    '&&REPOSITORY_OWNER');
   sys.build_xview('X$KSQST',    '&&REPOSITORY_OWNER');
   sys.build_xview('x$ksuse',    '&&REPOSITORY_OWNER');
   sys.build_xview('X$KGLOB',    '&&REPOSITORY_OWNER');
   sys.build_xview('x$kgldp',    '&&REPOSITORY_OWNER');
   sys.build_xview('x$kgllk',    '&&REPOSITORY_OWNER');


   IF (SUBSTR(ora_version,1,1)='8' OR SUBSTR(ora_version,1,1)='9' OR SUBSTR(ora_version,1,2)IN('10','11','12')) THEN
      sys.build_xview('X$KCBWDS',  '&&REPOSITORY_OWNER');
      sys.build_xview('X$KCBWBPD', '&&REPOSITORY_OWNER');
      IF (SUBSTR(ora_version,1,3)='8.1' OR SUBSTR(ora_version,1,1)='9' OR SUBSTR(ora_version,1,2)IN('10','11','12')) THEN
         sys.build_xview('X$KTFBUE',   '&&REPOSITORY_OWNER');
         sys.build_xview('X$KTFBFE',   '&&REPOSITORY_OWNER');
         sys.build_xview('X$KTFBHC',   '&&REPOSITORY_OWNER');
         EXECUTE IMMEDIATE 'grant SELECT on dba_temp_files to  &&REPOSITORY_OWNER';
         IF (SUBSTR(ora_version,1,1)='9' OR SUBSTR(ora_version,1,2) IN ('10','11','12')) THEN
            EXECUTE IMMEDIATE 'grant select any dictionary to      &&REPOSITORY_OWNER';
            IF (SUBSTR(ora_version,1,2)IN('10','11','12')) THEN
                sys.build_xview('X$KSXPIA',   '&&REPOSITORY_OWNER');
                sys.build_xview('X$KCCAGF',   '&&REPOSITORY_OWNER');
                sys.build_xview('x$kmgsop',   '&&REPOSITORY_OWNER');
                --sys.build_xview('x$kmgsct',   '&&REPOSITORY_OWNER');
                DECLARE
                   table_already_exists EXCEPTION;
                   PRAGMA EXCEPTION_INIT (table_already_exists, -955);
                   table_not_exists EXCEPTION;
                   PRAGMA EXCEPTION_INIT (table_not_exists, -942);
                BEGIN
                   BEGIN
                      EXECUTE IMMEDIATE 'CREATE OR REPLACE VIEW X_$KMGSCT AS SELECT ADDR,INDX,INST_ID,GRANTYPE,GRANSIZE,COMPONENT,OPCODE,OPMODE,PARNO,CURSIZE,USERSIZE,INITSIZE,TARGSIZE,MINSIZE,MAXSIZE,OPERCNT,LASTOPER,LASTMODE,LASTTIME,STARTTIME FROM X$KMGSCT';
                   EXCEPTION
                      WHEN table_already_exists
                      THEN
                         NULL;
                      WHEN table_not_exists
                      THEN
                         NULL;
                   END;

                   BEGIN
                      EXECUTE IMMEDIATE 'create or replace public synonym X$KMGSCT for X_$KMGSCT';
                   EXCEPTION
                      WHEN table_already_exists
                      THEN
                         NULL;
                   END;

                   BEGIN
                      EXECUTE IMMEDIATE 'grant SELECT on X_$KMGSCT to &&REPOSITORY_OWNER';
                   EXCEPTION
                      WHEN table_already_exists
                      THEN
                         NULL;
                   END;
                END;
            END IF;
         END IF;
      END IF;
   END IF;

   EXECUTE IMMEDIATE 'grant select  on obj$ to             &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on col$ to             &&REPOSITORY_OWNER';

   EXECUTE IMMEDIATE 'grant select  on ts$ to              &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on fet$ to             &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on uet$ to             &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on file$ to            &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on user$ to            &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on seg$ to             &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on undo$ to            &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on dba_extents to      &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on dba_free_space to   &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on dba_indexes to      &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on dba_ind_columns to  &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on dba_tab_columns to  &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on dba_tab_privs to    &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on dba_jobs to         &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on dba_data_files to   &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on dba_objects to      &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on dba_jobs to         &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on dba_jobs_running to &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant select  on dba_tables to       &&REPOSITORY_OWNER';

   IF SUBSTR(ora_version,1,2) IN('10','11','12') THEN
      EXECUTE IMMEDIATE 'grant select on dba_users                    to &&REPOSITORY_OWNER';
      EXECUTE IMMEDIATE 'grant select on dba_objects                  to &&REPOSITORY_OWNER';
      EXECUTE IMMEDIATE 'grant select on dba_hist_active_sess_history to &&REPOSITORY_OWNER';
   END IF;

   IF SUBSTR(ora_version,1,2) IN('11','12') THEN
      EXECUTE IMMEDIATE 'grant execute on dbms_result_cache           to &&REPOSITORY_OWNER';
      EXECUTE IMMEDIATE 'grant create job                             to &&REPOSITORY_OWNER';
   END IF;

   EXECUTE IMMEDIATE 'grant execute on dbms_system to     &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant execute on utl_file    to     &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant execute on dbms_job to        &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant execute on dbms_lob to        &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant create  table to              &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant create  procedure to          &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant create  view to               &&REPOSITORY_OWNER';
   EXECUTE IMMEDIATE 'grant create  any directory to      &&REPOSITORY_OWNER';

   -- Directory creation
   IF (SUBSTR(ora_version,1,1)='9' OR SUBSTR(ora_version,1,2) IN ('10','11','12')) THEN
      FOR c1_cur IN c1
      LOOP
         IF c1_cur.dir_exists = 'F'
         THEN
            EXECUTE IMMEDIATE 'create or replace directory ' || c1_cur.NAME
                                   || ' as ''' || c1_cur.VALUE || '''';
         END IF;

         EXECUTE IMMEDIATE    'grant read on directory ' || c1_cur.NAME
                                || ' to &&REPOSITORY_OWNER';
      END LOOP;
   END IF;

END;

