CREATE OR REPLACE PACKAGE QUEST_LUCY_COLLECTOR
   AUTHID CURRENT_USER
AS
   /**
    *  2012 Quest Software, Inc.
    * ALL RIGHTS RESERVED.
    *
    * Privileges needed to install this package:
    *   CREATE SESSION
    *   CREATE PROCEDURE
    *
    * In order to work with CLOBs the package will need EXECUTE on DBMS_LOB.
    *
    * The package needs access to various performance views to collect data.
    * The user will need access to these either through the role
    * SELECT_CATALOG_ROLE or the system privilege SELECT ANY DICTIONARY.
    * Alternatively the user can have SELECT privileges on the individual views
    * either granted directly or to a role the user has been granted.
    *
    * The following is a list of the SYS views accessed by this package:
    *
    *   All versions:
    *     v_$version
    *     v_$active_instances
    *     gv_$instance
    *     gv_$database
    *     gv_$system_event
    *     dba_data_files
    *     dba_temp_files
    *     dba_roles
    *     dba_jobs (If calling package from another schema)
    *     gv_$db_cache_advice
    *     gv_$pga_target_advice
    *     gv_$system_parameter
    *     gv_$pgastat
    *     gv_$sysstat
    *     gv_$archive_dest
    *     gv_$log
    *     gv_$logfile
    *
    *   10g and earlier:
    *     gv_$filestat
    *     gv_$tempstat
    *     dba_tablespaces
    *
    *   10g only:
    *     gv_$sga_dynamic_components
    *
    *   10g and higher:
    *     gv_$sys_time_model
    *     gv_$osstat
    *
    *   11g and higher:
    *     gv_$memory_dynamic_components
    *     gv_$iostat_file
    *
    * The package will try to create a table and schedule a job every 10 minutes
    * in order get continuous data when the client is not connected. In order
    * for this to work the user will need the following privileges:
    *
    *   All versions:
    *     CREATE TABLE
    *     CREATE SEQUENCE
    *     EXECUTE on DBMS_UTILITY
    *     EXECUTE on DBMS_JOB
    *     EXECUTE on DBMS_IJOB (Only if trying to schedule job in another schema)
    *
    *   11g and higher:
    *     CREATE JOB
    *     CREATE ANY JOB (Only if trying to schedule job in another schema)
    *     EXECUTE on DBMS_SCHEDULER
    *
    *   On first run it will create the objects - if this is being called from
    *   another schema the user will also need privileges to create objects in
    *   that schema:
    *     CREATE ANY TABLE
    *     CREATE ANY SEQUENCE
    *
    *   To call the package from another schema once it has been installed the
    *   user will need the following privileges:
    *     EXECUTE on QUEST_LUCY_COLLECTOR
    *     SELECT, DELETE on QUEST_LUCY_SNAPSHOT
    *
    */

   /* Variables need to be public so they can be passed to dynamic execution
      These variables will get reset at the start of each procedure/function */
   TYPE typ_number_table IS TABLE OF NUMBER
                               INDEX BY PLS_INTEGER;

   g_snapshot_xml       CLOB;
   g_snapshot_id_list   typ_number_table;

   /* Take a snapshot of performance metrics and save them in the
      QUEST_LUCY_SNAPSHOT table */

   PROCEDURE take_snapshot;

   /* Gets snapshots. If the job is scheduled it will return the snapshots that
      have been collected by the job. If the job cannot be scheduled or has been
      disabled then it will get a snapshot of the current metrics. It will
      also check if the table is created and job is scheduled - if not it will
      attempt to create these.

      If i_schedule_collector is set to anything other than 1 it will skip all
      object creation and simply return a snapshot of the current database. */

   FUNCTION get_snapshots (i_schedule_collector NUMBER := 1)
      RETURN CLOB;

   /* Drop the installed objects. */

   PROCEDURE drop_objects;
END QUEST_LUCY_COLLECTOR;

